import React from "react";
import "./C.css";
import Service from "../service/Service";

class Css extends React.Component{
    constructor(props){
        super(props)
        this.state={
            csss:[]
        }
    }
    componentDidMount(){
        Service.getCss().then((response) => {
            this.setState({csss:response.data})

        });
    }
    render(){
        return(
            <div>
                <div>
                    {
                        this.state.csss.map(
                        css =>
                        <ul key={css.id}>
                            <Link to="/html"><li>{css.name}</li></Link>
                        </ul>
                        )

                    }
                </div>
            </div>
        )
    }
}
export default Css;
